# MCUs

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_440030001251313236343430-if00
restart_method: command

[mcu EBB36]
canbus_uuid: fca3a5bf95e0

[printer]
kinematics: corexy
max_velocity: 1000
max_accel: 19200
max_accel_to_decel: 19200
max_z_velocity: 15          #Max 15 for 12V TMC Drivers, can increase for 24V
max_z_accel: 350
square_corner_velocity: 30

#####################################################################
#   X/Y Stepper Settings
#####################################################################

##  B Stepper - Left
##  Connected to MOTOR_1
##  Endstop connected to EBB36:
[stepper_x]
step_pin: PC13
dir_pin: !PC14
enable_pin: !PE6
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  #set to 400 for 0.9 degree stepper
position_min: -10
position_endstop: 352.5
position_max: 352.5
homing_positive_dir: true
homing_speed: 150 #Max 100
homing_retract_dist: 0

[tmc5160 stepper_x]
cs_pin: PG14
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: False
run_current: 2.80
sense_resistor: 0.075
stealthchop_threshold: 0
driver_TBL: 0
driver_TOFF: 3
driver_TPFD: 0
driver_HEND: 7
driver_HSTRT: 7


##  A Stepper - Right
##  Connected to MOTOR_1
##  Endstop connected to DIAG_1
[stepper_y]
step_pin: PE4
dir_pin: !PE5
enable_pin: !PE3
microsteps: 16
rotation_distance: 40
full_steps_per_rotation: 200  #set to 400 for 0.9 degree stepper
position_min: -10
position_endstop: 359
position_max: 359
homing_speed: 150  #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc5160 stepper_y]
cs_pin: PG13
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: False
run_current: 2.80
sense_resistor: 0.075
stealthchop_threshold: 0
driver_TBL: 0
driver_TOFF: 3
driver_TPFD: 0
driver_HEND: 7
driver_HSTRT: 7

#####################################################################
#   Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left
##  Connected to MOTOR_2
[stepper_z]
step_pin: PE1
dir_pin: !PE0
enable_pin: !PE2
microsteps: 16
endstop_pin: probe:z_virtual_endstop # use cartographer as virtual endstop
homing_retract_dist: 0 # cartographer needs this to be set to 0
rotation_distance: 40
gear_ratio: 80:16
position_min: -10
position_max: 310

[tmc5160 stepper_z]
cs_pin: PG12
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z1 Stepper - Rear Left
##  Connected to MOTOR_3
[stepper_z1]
step_pin: PB8
dir_pin: PB9
enable_pin: !PB7
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z1]
cs_pin: PG11
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z2 Stepper - Rear Right
##  Connected to MOTOR_4
[stepper_z2]
step_pin: PB5
dir_pin: !PB4
enable_pin: !PB6
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z2]
cs_pin: PG10
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0

##  Z3 Stepper - Front Right
##  Connected to MOTOR_5
[stepper_z3]
step_pin: PG15
dir_pin: PB3
enable_pin: !PD5
microsteps: 16
rotation_distance: 40
gear_ratio: 80:16

[tmc5160 stepper_z3]
cs_pin: PG9
spi_software_miso_pin: PE13
spi_software_mosi_pin: PE14
spi_software_sclk_pin: PE12
interpolate: True
run_current: 0.80
sense_resistor: 0.075
stealthchop_threshold: 0


#####################################################################
#   Extruder
#####################################################################

##  Connected to MOTOR_6
##  Heater - HE0
##  Thermistor - T0
[extruder]
step_pin: EBB36:MOT_STEP
dir_pin: EBB36:MOT_DIR
enable_pin: !EBB36:MOT_EN
heater_pin: EBB36:HE0
rotation_distance: 47.088       #LDO Galileo 2
gear_ratio: 9:1                 #LDO Galileo 2
#rotation_distance: 22.6789511  #Bondtech 5mm Drive Gears
#gear_ratio: 50:8               #BMG Gear Ratio - CW2
microsteps: 16                  #Default 32
full_steps_per_rotation: 200    #200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.8
filament_diameter: 1.75
instantaneous_corner_velocity: 1.5
max_extrude_cross_section: 10
#sensor_type: ATC Semitec 104NT-4-R025H42G # For Revo Voron
#sensor_pin: EBB36:TH0                     #
sensor_type: MAX31865
sensor_pin: EBB36:PA4
spi_bus: spi1
rtd_nominal_r: 1000
rtd_reference_r: 4300
rtd_num_of_wires: 2
min_temp: 0
max_temp: 350
pwm_cycle_time: 0.02
smooth_time: 0.5
min_extrude_temp: 170
pressure_advance: 0.013
pressure_advance_smooth_time: 0.015
max_extrude_only_distance: 100
control = pid
pid_kp = 20.873
pid_ki = 1.016
pid_kd = 107.244

[tmc2209 extruder]
uart_pin: EBB36:MOT_UART
run_current: 0.6
stealthchop_threshold: 999999
interpolate: True

#####################################################################
#   Bed Heater
#####################################################################

[heater_bed]
##  SSR Pin - HE0
##  Thermistor - TB
heater_pin: PF6
sensor_type: Generic 3950
sensor_pin: PB1
pwm_cycle_time: 0.0166
max_power: 1.0
min_temp: 0
max_temp: 120
#control: pid
#pid_kp: 58.437
#pid_ki: 2.347
#pid_kd: 363.769

